import React from "react";
import Json from "./Json";



function UserPage(){

    // const [County, setcounty] = useState('');
    // const [datetime, setdate] = useState('');
    // const [temp, setTemp] = useState('');
    // const [humidity, setHum] = useState('');
    // const [day30, setday30] = useState('');
    // const [day60, setday60] = useState('');
    // const [day90, setday90] = useState('');



    const handleCountyChange = event => {
        Json.setcounty(event.target.value);
    };

    const handleDateChange = event => {
        Json.setdate(event.target.value);
      };

    const handleTempChange = event => {
        Json.setTemp(event.target.value);
      };

    const handleHumChange = event => {
        Json.setHum(event.target.value);
      };

    const handle30Change = event => {
        Json.setday30(event.target.value);
      };

    const handle60Change = event => {
        Json.setday60(event.target.value);
      };
    const handle90Change = event => {
        Json.setday90(event.target.value);
      };

    function handleSubmit(e){
        console.log("you click the button");
        console.log('county value is:', Json.County);
        console.log('date value is:', Json.datetime);
        console.log('temp value is:', Json.temp);
        console.log('hum value is:', Json.humidity);
        console.log('30 value is:', Json.day30);
        console.log('60 value is:', Json.day60);
        console.log('90 value is:', Json.day90);
    }


    return (
        <div>
            <h1>Hi this is a wildfire prediction</h1>

            <label>County: </label>
            <input 
                type="text" 
                id ="County" 
                name ="County" 
                onChange={handleCountyChange}
                value={Json.County}
                placeholder="Enter County">
            </input>
            <br></br>

            <label>Date: </label>
            <input 
                type="date" 
                name="datetime"
                onChange={handleDateChange}
                value={Json.datetime}
            ></input>
            <br></br>

            <label>Temp: </label>
            <input 
                type="float" 
                name="temp" 
                onChange={handleTempChange}
                value={Json.temp}
                placeholder="Enter Temp in Celius">
            </input>
            <br></br>

            <label>Hum: </label>
            <input 
                type="float" 
                name="Hum" 
                onChange={handleHumChange}
                value={Json.humidity}
                placeholder="Enter Hum in %">
            </input>
            <br></br>

            <label>30-day avg prec: </label>
            <input 
                type="float" 
                name="30-day avg prec" 
                onChange={handle30Change}
                value={Json.day30}
                placeholder="Enter 30-day avg precipitation in inches">
            </input>
            <br></br>

            <label>60-day avg prec: </label>
            <input 
                type="float" 
                name="60-day avg prec" 
                onChange={handle60Change}
                value={Json.day60}
                placeholder="Enter 60-day avg precipitation in inches">
            </input>
            <br></br>

            <label>90-day avg prec: </label>
            <input 
                type="float" 
                name="90-day avg prec" 
                onChange={handle90Change}
                value={Json.day90}
                placeholder="Enter 90-day avg precipitation in inches">
            </input>
            <br></br>

            <button type="button" name= "submit" onClick={handleSubmit}>Sumbit</button>
        </div>
    );
}

export default UserPage;
